        _tags?.add(v.fromJson(v));
      });
    }
    _total = json['total'];
    _offset = json['offset'];
    if (json['subcategories'] != null) {
      _subcategories = [];
      json['subcategories'].forEach((v) {
        _subcategories?.add(v.fromJson(v));
      });
    }
